import axios from "axios";
const baseurl = "http://localhost:3001";

// admin login
export const adminLogin = async (username, password) => {
  return await axios({
    method: "POST",
    url: baseurl + "/admin-login",
    data: {
      username: username,
      password: password,
    },
  }).then((response) => {
    return response.data;
  });
};

// create admin
export const createAdmin = async (username, password, token) => {
  console.log(token);
  return await axios({
    method: "POST",
    url: baseurl + "/create-admin",
    data: {
      username: username,
      password: password,
    },
    headers: {
      Authorization: `Bearer ${token}`,
    },
  }).then((response) => {
    return response.data;
  });
};

// create party
export const createParty = async (name) => {
  return await axios({
    method: "POST",
    url: baseurl + "/create-party",
    data: {
      name: name,
    },
    headers: {
      Authorization: `Bearer ${token}`,
    },
  }).then((response) => {
    return response.data;
  });
};
